import './App.css';
import ListItem from './ListItem';
import { getRamal } from './RamalService';
import { useEffect, useState } from 'react';

function App() {
  const [ramais, setRamal] = useState([]);

  useEffect(() => {
    setRamal(getRamal());
  }, [])

  return (
    <div className="create-container">
      <div className="create-container">
      <create-title>
      {ramais.map(ramal => {
        return (
          <ListItem
            key={ramal.nome}
            nome={ramal.nome}
            numero={ramal.numero}
          />
        )
      })}
      </create-title>
      </div>
    </div>
  );
}

export default App;
